def count_possible_orders(N, A):
    mod = 10 ** 9 - 7
    c_dic = {}
    if N % 2 == 0:
        for num in A:
            if num % 2 == 0 or num >= N:
                return 0
            if num in c_dic:
                c_dic[num] += 1
                if c_dic[num] > 2:
                    return 0
            else:
                c_dic[num] = 1
        return pow(2, N // 2, mod)
    else:
        for num in A:
            if num % 2 == 1 or num >= N:
                return 0
            if num in c_dic:
                c_dic[num] += 1
                if c_dic[num] > 2:
                    return 0
            else:
                c_dic[num] = 1
        if c_dic.get(0, 0) != 1:
            return 0
        return pow(2, N // 2, mod)

